import { styled } from "styled-components";
import Layout from "../../components/layout/Layout";
import DetailList from "./components/DetailList";

const StyledDetail = styled.div`
  padding: 70px 300px;
`;
const Detail = () => {
  return (
    <Layout>
      <div>
        <DetailList />
      </div>
    </Layout>
  );
};

export default Detail;
